import React from 'react';
import { Link } from 'react-router-dom';
import { createBrowserHistory } from 'history';
import CryptoPortfolioForm from './HomeUserPage'; // Adjust the path based on your project structure
import { Container, Heading, Form, Button, NavLinks, NavLink } from './styles'; // Assuming you have styles.js for styling

const LoginPage = () => {
  const history = createBrowserHistory();

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    // Assuming successful login, navigate to CryptoPortfolioForm
    history.push('/crypto-portfolio');
  };

  return (
    <Container className="mt-5">
      <Heading>Logovanje postojeceg korisnika</Heading>
      <Form onSubmit={handleSubmit}>
        <div className="mb-3">
          <label htmlFor="email_log" className="form-label">Unesite email adresu:</label>
          <input type="text" name="email_log" required className="form-control" />
        </div>
        <div className="mb-3">
          <label htmlFor="password_log" className="form-label">Unesite sifru:</label>
          <input type="password" name="password_log" required className="form-control" />
        </div>
        <div>
          <Button type="submit">
            <i className="bi bi-plus-circle-dotted"></i> Prijavi se
          </Button>
          <button type="reset" className="btn btn-outline-secondary">Obrisi podatke</button>
          {/* You can add onClick to the button for programmatic navigation */}
          <Button type="button" onClick={() => history.push('/crypto-portfolio')}>
            <i className="bi bi-arrow-right"></i> Idite na Crypto Portfolio
          </Button>
        </div>
      </Form>
      <div className="mt-3">
        <Link to="/">Back to Home</Link>
      </div>
    </Container>
  );
};

export default LoginPage;
